import React from 'react';
import './Portfolio.css';
import Projects from './Project';

const Portfolio = () => {
  return (
    <div>
    <section className="portfolio-section">
      <div className="portfolio-background">
        <div className="portfolio-overlay">
          <h1>Our Portfolio</h1>
        </div>
      </div>
    </section>
    <div>
        <Projects />
    </div>
    </div>


  );
};

export default Portfolio;
